const solution = S => {
  const {length: len} = S;
  let count = 0;

  for (let i = 0; i < len; i++) {
    if (S[i] === S[i + 1] && S[i] === S[i + 2]) {
      count++;
      i += 2;
    }
  }

  return count;
};

console.log(solution('baaaaa'));    // должна вернуть 1
console.log(solution('baaabbaabbba'));    // должна вернуть 2
console.log(solution('baabab'));    // должна вернуть 0
console.log(solution(''));    // должна вернуть 10000
